import React, { Component } from 'react';

class ImageList extends Component {
    constructor(){
        super();
        this.state = {

        }
    }
    render(){
        console.log(this.props, 'this.props imagelist')
        const images = this.props.images.map((image, i) => {
            console.log(image.images, 'from images')
            return(
                <img src={ image.images[i] } />
            )
        })
        return(
            <div>
                { images }
            </div>
        )
    }
}

export default ImageList;

